lista_nova <- list()

# alterar o codigo das series
for(i in c(1:length(listaSeries))){

  # Split the text at commas 
  split_text <- unlist(strsplit(listaSeries[[i]], "','", fixed = TRUE))
  
  # substituir o numero pela combinacao de data e hora
  split_text[[1]] <- sub("\\b\\d{6}\\b", paste0("'numero': ", "'",UUIDgenerate(),"'"), split_text[[1]])
  
  # substituir a primeira virgula por "nome"
  split_text[[1]] <- paste0(sub("','", "', 'nome': '", split_text[[1]]),"'")
  
  # trocar nome cadastroSeries pelo nome que o banco de dados aceita
  split_text[[1]] <- sub("cadastroSeries\\(","<String, dynamic>{",split_text[[1]])
  
  # substituir a primeira virgula por "nomeCompleto"
  split_text[[2]] <- paste0("'nomeCompleto': ", "'", split_text[[2]], "'")
  
  # substituir a primeira virgula por "descricao"
  split_text[[3]] <- paste0("'descricao': ", "'", split_text[[3]], "'")
  
  # substituir a primeira virgula por "formato"
  split_text[[4]] <- paste0("'formato': ", "'", split_text[[4]], "'")
  
  # substituir a primeira virgula por "fonte"
  split_text[[5]] <- paste0("'fonte': ", "'", split_text[[5]], "'")
  

  split_text_7 <- unlist(strsplit(split_text[[6]], ",", fixed = TRUE))
  split_text_7[[1]] <- paste0("'urlAPI': ", "'", split_text_7[[1]])
  split_text_7[[2]] <- paste0("'idAssunto': ", split_text_7[[2]])
  split_text_7[[3]] <- paste0("'periodicidade': ", split_text_7[[3]],"'")
  
  split_text[[6]] <- paste(split_text_7, collapse = ",")
  
  # substituir a primeira virgula por "metrica"
  split_text[[7]] <- paste0("'metrica': ", "'", split_text[[7]], "'")
  
  # substituir a primeira virgula por "nivelGeografico"
  split_text[[8]] <- paste0("'nivelGeografico': ", "'", split_text[[8]], "'")
  
  # substituir a primeira virgula por "localidades"
  split_text[[9]] <- paste0("'localidades': ", "'", split_text[[9]], "'")
  
  # substituir a primeira virgula por "categoria"
  split_text[[10]] <- paste0("'categoria': ", "'", split_text[[10]])
  
  # substituir o parenteses no final
  split_text[[10]] <- sub("'),", "'},", split_text[[10]])
  
  lista_nova[[i]] <- paste(split_text, collapse = ",")
}

